  false,\n\t\"url\": null,\n\t\"notes\": \" n        The impact evaluation study of
  the MCA-M PRP will be the first fully randomized evaluation of a large-scale land
  titling program. Randomization will occur at the geographic level akin to a neighborhood.
  Mongolian cities are divided up into a number of administrative units - the smallest
  being the u201ckhesegu201d.   Khesegs were chosen as the unit of randomization for
  the study because they are a well-defined unit that is small and numerous enough
  to allow for sufficient statistical power. The baseline estimation strategy will
  be a differences-in-differences approach, where we compare the outcomes of households
  in the treatment group with the control group as well as before and after the completion
  of the formalization activities. Exposure to treatment was 66% in Darkhan and Erdenet,
  and 50% in Ulaanbaatar districts. There are no results to report as of now because
  only the baseline has been conducted so far.n      \",\n\t\"license_title\": \"License
